import './Quote.css';

function Quote() {
  return (
    <section id='quote-section' className='full-cover'>
      <article>
        <hgroup>
          <h1><i>"Difficulties mastered</i></h1>
          <h1><i>are opportunities won"</i></h1>
          <h4>- Winston Churchill</h4>
        </hgroup>
      </article>
    </section>
  );
}

export default Quote;
